    public List<AddRoleResultEventResponse> getAddRoleResultEvents(TransactionReceipt transactionReceipt) {
        List<Contract.EventValuesWithLog> valueList = extractEventParametersWithLog(ADDROLERESULT_EVENT, transactionReceipt);
        ArrayList<AddRoleResultEventResponse> responses = new ArrayList<AddRoleResultEventResponse>(valueList.size());
        for (Contract.EventValuesWithLog eventValues : valueList) {
            AddRoleResultEventResponse typedResponse = new AddRoleResultEventResponse();
            typedResponse.log = eventValues.getLog();
            typedResponse.count = (BigInteger) eventValues.getNonIndexedValues().get(0).getValue();
            responses.add(typedResponse);
        }
        return responses;
    }

